import{_ as a,o as e,c as o,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 33.2-719  Abandonment of certain highways and railway crossings.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-719.md","filePath":"vacode/33.2-719.md"}'),t={name:"vacode/33.2-719.md"},r=n('<h1 id="§-33-2-719-abandonment-of-certain-highways-and-railway-crossings" tabindex="-1">§ 33.2-719 Abandonment of certain highways and railway crossings. <a class="header-anchor" href="#§-33-2-719-abandonment-of-certain-highways-and-railway-crossings" aria-label="Permalink to &quot;§ 33.2-719  Abandonment of certain highways and railway crossings.&quot;">​</a></h1><p>The governing body of any county that has chosen or hereafter chooses not to be included in the provisions of Article 3 (§ <a href="/vacode/33.2-324/">33.2-324</a> et seq.) of Chapter 3, whenever it deems that any part of a highway subject to its jurisdiction is no longer required or an existing crossing by any such highway of the lines of a railway company, or any existing crossing by the lines of a railway company of such highway, is no longer necessary as a part of such highway system, may abandon the section of highway or the crossing.</p><p>The procedure for any such abandonment shall be governed by the provisions applicable to the Board as provided in Articles 1, 2, and 3 (§§ <a href="/vacode/33.2-900/">33.2-900</a> through <a href="/vacode/33.2-926/">33.2-926</a>) of Chapter 9 and all provisions applicable to the Board shall apply, mutatis mutandis, to the governing body of the county.</p><p>Code 1950, § 33-155.1; 1970, c. 322, § 33.1-243; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',4),s=[r];function i(h,c,d,l,p,y){return e(),o("div",null,s)}const _=a(t,[["render",i]]);export{g as __pageData,_ as default};
